import React from 'react'

export default function Home(props) {
    return (
        <main>
            <div className='main'>
                <h1 className='home-header'>Quiz</h1>
                <button 
                    className='home-button'
                    onClick={props.newGame}
                >
                    Start quiz
                </button>
            </div>
        </main>
    )
}
